import React, { Component } from "react";

class Try extends Component {
  render() {
    const { tryInfo } = this.props; // 구조 분해 문법
    return (
      <>
        <div>
          [{tryInfo.try}] {tryInfo.result}
        </div>
      </>
    );
  }
}

export default Try;
